import React, { Component } from 'react';

class FilterBar extends Component {
  constructor(props) {
    super(props);

    this.state = {
      filter: 'all',
    }
  }

  render() {
    return (
      <div className="card small">hello</div>
    );
  }
}

export default FilterBar;
